import React, { useState } from 'react';
import {
  Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField, Stack
} from '@mui/material';

function AddDeviceDialog({ open, onClose, onAdd }) {
  const [newDevice, setNewDevice] = useState({
    name: '', location: '', waterFlow: 0, pressure: 0, temperature: 0
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewDevice(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = () => {
    onAdd(newDevice);
    onClose();
  };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Add New Device</DialogTitle>
      <DialogContent>
        <Stack spacing={2}>
          <TextField label="Device Name" name="name" onChange={handleChange} fullWidth />
          <TextField label="Location" name="location" onChange={handleChange} fullWidth />
          <TextField label="Water Flow (L/s)" name="waterFlow" type="number" onChange={handleChange} fullWidth />
          <TextField label="Pressure (psi)" name="pressure" type="number" onChange={handleChange} fullWidth />
          <TextField label="Temperature (Â°C)" name="temperature" type="number" onChange={handleChange} fullWidth />
        </Stack>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Cancel</Button>
        <Button onClick={handleSubmit}>Add</Button>
      </DialogActions>
    </Dialog>
  );
}

export default AddDeviceDialog;
